import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import {
  KBarProvider,
  KBarContent,
  KBarPortal,
  KBarSearch,
  KBarResults,
} from "kbar";
import "bootstrap/dist/css/bootstrap.css";

const actions = [
  {
    id: "home",
    name: "Home",
    shortcut: ["h"],
    keywords: "home",
    perform: () => (window.location.pathname = "/"),
  },
  {
    id: "projects",
    name: "Projects",
    shortcut: ["p"],
    keywords: "project",
    perform: () => (window.location.pathname = "projects"),
  },
  {
    id: "about",
    name: "About",
    shortcut: ["a"],
    keywords: "about",
    perform: () => (window.location.pathname = "about"),
  },
];

ReactDOM.render(
  <KBarProvider actions={actions}>
    {/* <KBarPortal>
      <KBarSearch />
      <KBarResults />
    </KBarPortal> */}
    <App />
  </KBarProvider>,
  document.getElementById("root")
);
